/** @format */

import React from "react";
import "./App.css";

function App(props) {
  return (
    <div>
      <div className="nav-bar">
        <div>Ajay</div>
        <ul>
          <li>Home</li>
          <li>Contact Us</li>
          <li>For More</li>
        </ul>
      </div>
    </div>
  );
}

export default App;
